css:
.nuclide-diagnostics-status-bar-highlight {
  display: inline-block;
  line-height: 1.3em;
  min-width: 2em;
  text-align: center;
}
.nuclide-diagnostics-highlight-group {
  cursor: pointer;
  display: inline-block;
}
.nuclide-diagnostics-highlight-group .nuclide-diagnostics-status-bar-highlight:first-child {
  border-bottom-right-radius: 0;
  border-top-right-radius: 0;
}
.nuclide-diagnostics-highlight-group .nuclide-diagnostics-status-bar-highlight:last-child {
  border-bottom-left-radius: 0;
  border-top-left-radius: 0;
}
